import React from 'react';
import { Card, ListGroup, ListGroupItem } from 'react-bootstrap'
const custom_style = { backgroundColor: "#fafafa" };

function InformationComponent(information_announcement) {
    return (
        <div className="InformationComponent">
            <Card style={{ borderRadius: "10px" , padding:"20px"}}>
                <Card.Img variant="top" />
                <Card.Body>
                    <Card.Title>Information </Card.Title>
                    <Card.Text>Announcement</Card.Text>
                </Card.Body>
                <ListGroup className="list-group-flush">
                {Array.from(information_announcement).map((info)=> <Card.Text>{console.log(info)}</Card.Text> )}
                </ListGroup>
            </Card>
        </div>
    )
}

export default InformationComponent;
